import React from "react";
import styled from "styled-components";

const TeamCard = ({ name, title, img, desc }) => {
  return (
    <Container>
      <img src={img} alt={name} />
      <div className="name">{name}</div>
      <div className="title"> {title} </div>
      <div className="desc">{desc} </div>
    </Container>
  );
};

export default TeamCard;

const Container = styled.div`
  width: 40vw;
  height: 35vh;
  background: #ffffff;
  box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
  border-radius: 5px;
  position: relative;
  img {
    width: 35%;
    height: 25%;
    position: absolute;
    top: -38%;
    left: 33%;
    height: 25%;
  }
  .name {
    font-weight: 300;
    font-size: 48px;
    letter-spacing: 0.21em;
    margin: 50px 0 0 0;
  }
  .title {
    font-weight: 200;
    font-size: 32px;
    line-height: 132%;
    margin: 10px 0 0 0;
    letter-spacing: 0.21em;
    color: #6c6a6a;
  }
  .desc {
    font-weight: 200;
    font-size: 18px;
    line-height: 132%;
    width: 80%;
    margin: 25px auto;
    /* or 32px */

    letter-spacing: 0.03em;
  }
`;
